    return(
    <div>
        <div className="field has-addons is-small">
            <div className="control is-small">
              <input className="input is-small" type="text" placeholder="City" value={city}></input>
            </div>
        <div className="control">
            <a className="button is-black is-small ">
            Search
            </a>
        </div>
        </div>
    </div>    
    )


    
}
export default Search;
